import './App.css';
import Home from './Home';
import Header from './Header';
import Footer from './Footer';
import SearchPage from './SearchPage'
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';

function App() {
  return (
    // BEM
    <div className="app">
      <Router>
        <Header />

        <Routes>
          <Route path='/'>
            <Home />
          </Route>

          <Route path='/search'>
          </Route>

        </Routes>

        <Footer />
      </Router>
    </div>
  );
}

export default App;
